import React from 'react'
import './ownInfo.css'

/**
 * 基本的公共的引入
 */
import './../commons/layoutcom.css'
import HeaderPrivate from './../components/HeaderPrivate'
import Bottom from './../components/Bottom'
import { withRouter } from 'react-router-dom'
import 'antd/dist/antd.css';
import { Layout,Card,Button,Divider} from 'antd';
import {
  MenuUnfoldOutlined,
  MenuFoldOutlined,
} from '@ant-design/icons';
import MenuComponent from './../components/MenuCom'
import {FetchDoGet,FetchDoPost} from './../commons/Utils'

//end

const { Header, Sider, Content} = Layout;


const gridStyle = {
    width: '20%',
    textAlign: 'center',
    margin:"3px"
};


/**
 * 个人基本信息页展示
 */
class OwnInfo extends React.Component{
    constructor(props){
        super(props)
        this.state={
            userData:null,
            collapsed: true,
            user:{},
            role:{},
            other:{}
        }
    }


    // state = {
    //         collapsed: false,
    //         userData:null
    // };

     toggle = () => {
        this.setState({
          collapsed: !this.state.collapsed,
        });
    };
      /**
       * 初始化我们的基本的数据操作
       */
      componentDidMount(){
        const _this=this;
            FetchDoGet("/block/v1/sys_user/getCurrentLoginUser",function(response){
                console.log("userinfo",response);
                _this.setState({
                    userData:response,
                    user:response.tbSystemUser,
                    role:response.tbSystemRole,
                    other:response.userOtherMessageInfo
                })
            });
      }


      render() {

        let {user,role,other}=this.state;

        return ( 
            <div>
                <HeaderPrivate name="zhaoligang"/>
                    <Layout className="layout-header">
                        <Sider theme="light" trigger={null} collapsible collapsed={this.state.collapsed}>
                        <div className="logo" />
                        <MenuComponent/>
                        </Sider>
                        <Layout className="site-layout">
                        <Header className="site-layout-background" style={{ padding: 0 }}>
                            {React.createElement(this.state.collapsed ? MenuUnfoldOutlined : MenuFoldOutlined, {
                            className: 'trigger',
                            onClick: this.toggle,
                            })}
                        </Header>
                        <Content
                            className="site-layout-background"
                            style={{
                            margin: '24px 16px',
                            padding: 24,
                            minHeight: 580,
                            }}
                        >
                            <Card style={{width:"100%"}} 
                            bordered={false}
                            hoverable={true}
                            title="用户的个人信息"
                            extra={<Button type="primary" style={{float:"right"}}>编辑个人信息</Button>}
                            >
                                <Card style={{width:"80%"}}>
                                    <Card.Grid hoverable={false}>用户名：{user.userName}</Card.Grid>
                                    <Card.Grid hoverable={false}>昵称：{user.userNickName}</Card.Grid>
                                    <Card.Grid hoverable={false}>手机：{user.userPhone}</Card.Grid>
                                    <Card.Grid hoverable={false}>邮件：{user.userEmail}</Card.Grid>
                                    <Card.Grid hoverable={false}>手机：{user.userPhone}</Card.Grid>
                                    <Card.Grid hoverable={false}>手机：{user.userPhone}</Card.Grid>
                                </Card>

                            </Card>

                            <Divider dashed={true}/>


                            <Card style={{width:"100%"}} 
                            bordered={false}
                            hoverable={true}
                            title="个人资产信息"
                            extra={<Button type="primary" style={{float:"right"}}>查看详情</Button>}
                            >

                            </Card>
                        </Content>
                        </Layout>
                    </Layout>
                <Bottom/>
            </div>
        );
      }
}//end
export default withRouter(OwnInfo)
